import React from 'react';
import Baner from './Baner/Baner';
import Board from './Board/Board';
import {board} from '../../data/imageData';

var el = document.querySelector( 'body' );
let counter = 0;

function changeImg() {
    counter = counter + 1;
    console.log(counter);
}

function rerNumb() {
    return 2;
}

const GameWrapper = () => (
    <div>
        <Baner />
        <Board 
            desc = {board[rerNumb()].description}
            img = {board[counter].image}
        />
    </div>
);

export default GameWrapper;
